import React from "react";
import Head from "next/head";
import AppLayout from "../components/AppLayout";
<script src="https://cdn.jsdelivr.net/npm/chart.js"></script>;
const Profile = () => (
  <AppLayout>
    <Head>
      <title>NTB</title>
    </Head>
    <div>
      <canvas id="myChart"></canvas>
    </div>
  </AppLayout>
);

export default Profile;
